import { JeecgListMixin } from '@/mixins/JeecgListMixin';
export default {
  name: "OSSFileList",
  mixins: [JeecgListMixin],
  data: function data() {
    return {
      description: '文件列表',
      // 表头
      columns: [{
        title: '#',
        dataIndex: '',
        key: 'rowIndex',
        width: 60,
        align: "center",
        customRender: function customRender(t, r, index) {
          return parseInt(index) + 1;
        }
      }, {
        title: '文件名称',
        align: "center",
        dataIndex: 'fileName'
      }, {
        title: '文件地址',
        align: "center",
        dataIndex: 'url'
      }, {
        title: '操作',
        dataIndex: 'action',
        align: "center",
        scopedSlots: {
          customRender: 'action'
        }
      }],
      url: {
        upload: "/oss/file/upload",
        list: "/oss/file/list",
        delete: "/oss/file/delete",
        minioUpload: "/sys/upload/uploadMinio"
      }
    };
  },
  computed: {
    uploadAction: function uploadAction() {
      return window._CONFIG['domianURL'] + this.url.upload;
    },
    minioUploadAction: function minioUploadAction() {
      return window._CONFIG['domianURL'] + this.url.minioUpload;
    }
  },
  methods: {
    beforeUpload: function beforeUpload(file) {
      var fileType = file.type;

      if (fileType === 'image') {
        if (fileType.indexOf('image') < 0) {
          this.$message.warning('请上传图片');
          return false;
        }
      } else if (fileType === 'file') {
        if (fileType.indexOf('image') >= 0) {
          this.$message.warning('请上传文件');
          return false;
        }
      }

      return true;
    },
    handleChange: function handleChange(info) {
      if (info.file.status === 'done') {
        if (info.file.response.success) {
          this.loadData();
          this.$message.success("".concat(info.file.name, " \u4E0A\u4F20\u6210\u529F!"));
        } else {
          this.$message.error("".concat(info.file.response.message));
        }
      } else if (info.file.status === 'error') {
        this.$message.error("".concat(info.file.response.message));
      }
    },
    ossDelete: function ossDelete(id) {
      var that = this;
      that.$confirm({
        title: "确认删除",
        content: "是否删除选中文件?",
        onOk: function onOk() {
          that.handleDelete(id);
        }
      });
    },
    handlePreview: function handlePreview(record) {
      if (record && record.url) {
        var url = window._CONFIG['onlinePreviewDomainURL'] + '?url=' + encodeURIComponent(record.url);
        window.open(url, '_blank');
      }
    }
  }
};
